import React, { useEffect, useState } from "react";
import axios from "axios";

export default function StudentProfilePage() {
  const [profileData, setProfileData] = useState(null);

  useEffect(() => {
    axios
      .get("http://localhost:4050profile")
      .then((response) => {
        setProfileData(response.data);
      })
      .catch((error) => {
        console.error("There was an error fetching the profile data!", error);
      });
  }, []);

  if (!profileData) {
    return <div>Loading...</div>;
  }

  return (
    <div className="profile-container">
      <div className="profile-header">
        <div className="profile-pic">
          <img src="student-profile-pic.jpg" alt="Profile of John Doe" />
        </div>
        <div className="profile-info">
          <h1>{profileData.name}</h1>
          <p>{profileData.username}</p>
          <p>{profileData.major}</p>
          <button className="edit-btn">Edit Profile</button>
        </div>
      </div>

      <div className="profile-content">
        <div className="bio">
          <h2>Bio</h2>
          <p>{profileData.bio}</p>
        </div>

        <div className="courses">
          <h2>Courses</h2>
          <ul>
            {profileData.courses.map((course, index) => (
              <li key={index}>{course}</li>
            ))}
          </ul>
        </div>

        <div className="grades">
          <h2>Recent Grades</h2>
          <ul>
            {Object.entries(profileData.grades).map(([course, grade], index) => (
              <li key={index}>
                {course}: {grade}
              </li>
            ))}
          </ul>
        </div>

        <div className="extracurriculars">
          <h2>Extracurricular Activities</h2>
          <ul>
            {profileData.extracurriculars.map((activity, index) => (
              <li key={index}>{activity}</li>
            ))}
          </ul>
        </div>

        <div className="posts">
          <h2>Recent Posts</h2>
          {profileData.posts.map((post, index) => (
            <div className="post" key={index}>
              <p><strong>{post.title}</strong></p>
              <p>{post.content}</p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}
